function dropDown(){document.getElementById("Dropdown").classList.toggle(".hide")}window.onclick=function(e){if(!e.target.matches("navbar_def_dropdown_btn")){let e,t=document.getElementsByClassName(".navbar_def_dropdown_content");for(e=0;e<t.length;e++){let n=t[e];n.classList.contains(".hide")?n.classList.remove(".hide"):n.classList.add(".hide")}}};